import { Link } from "react-router-dom";
import "../styles/PatientSidebar.css"; 

const PatientSidebar = () => {
  return (
    <aside className="patient-sidebar">
      <ul>
        <li><Link to="/patient-dashboard">üè† Dashboard</Link></li>
        <li><Link to="/find-doctor">üîé Find Doctor / Hospital</Link></li>
        <li><Link to="/video-consultation">üìπ Video Call</Link></li>
        <li><Link to="/appointments">üìÖ My Appointments</Link></li>
        <li><Link to="/health-seva">üíô Health Seva</Link></li>
        <li><Link to="/mobile-van">üöê Mobile Van Booking</Link></li>
        <li><Link to="/medical-records">üìÑ Medical Records</Link></li>
        <li><Link to="/insurance">üè• Govt. Health Schemes</Link></li>
      </ul>
    </aside>
  );
};

export default PatientSidebar;
